import React from "react";
import Button from "./Button";

export default class Dashboard extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  // Variables
  lastPack

  // Functions
  componentDidMount(){
    alert(this.lastPack)
  }


  render() {
    return (
      <div>
          <Button>+1 from last {`(` + this.lastPack + `)`}</Button>

        <Button>Choose active pack</Button>
        <Button>Add new pack</Button>
      </div>
    );
  }
}
